import React from "react";
import { Link, useNavigate } from "react-router-dom";
import styled from "styled-components";
import tt from "./exp.png";

function Navbar(props) {
  const history = useNavigate();
  const handleLogout = (e) => {
    e.preventDefault();
    localStorage.removeItem('token');
    history("/");
  }

  return (
    <NavbarStyled mode={props.mode}>
      <nav className={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
        <div className="container-fluid">
          <img src={tt} alt="" height={30} width={30} />
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/dashboard">Dashboard</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/income">Income</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/expense">Expense</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/transactions">Transactions</Link>
              </li>
            </ul>
            {!localStorage.getItem('token') ? 
              <form className="d-flex">
                <Link className="btn btn-primary mx-1" to="/" role="button">Login</Link>
                <Link className="btn btn-primary mx-1" to="/signup" role="button">Signup</Link>
              </form> 
              : 
              <div className="dropdown">
                <a className="btn btn-secondary dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                  {props.credentials.email}
                </a>
                <ul className="dropdown-menu dropdown-menu-dark">
                  <li><Link onClick={handleLogout} className="dropdown-item">Logout</Link></li>
                </ul>
              </div>
            }
            <div className={`form-check form-switch text-${props.mode === 'light' ? 'dark' : 'light'} mx-2 my-2`}>
              <input className="form-check-input" onClick={props.toggleMode} type="checkbox" role="switch" id="flexSwitchCheckDefault" />
              <label className="form-check-label" htmlFor="flexSwitchCheckDefault">Enable Dark</label>
            </div>
          </div>
        </div>
      </nav>
    </NavbarStyled>
  )
}

const NavbarStyled = styled.div`
.navbar {
  box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.1);
}

.nav-link {
  font-family: 'Arial', sans-serif;
  font-size: 20px;
  font-weight: 600;
  color: ${(props) => props.mode === 'light' ? '#333' : '#fff'};
  margin-right: 1rem;
  position: relative;
  padding: 0.5rem 1rem;
  transition: all 0.3s ease;

  &:hover {
    color: ${(props) => props.mode === 'light' ? '#fff' : '#333'};
    background-color: ${(props) => props.mode === 'light' ? 'rgba(0, 123, 255, 0.7)' : 'rgba(0, 123, 255, 0.7)'};
    border-radius: 0.25rem;
  }
}

.dropdown-menu {
  background-color: ${(props) => props.mode === 'light' ? '#fff' : '#343a40'};
  border-radius: 0.25rem;
  box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.1);
}

.form-check-input {
  cursor: pointer;
}
`;

export default Navbar;
